void TestLocalFitting(bool test) {
	{
		UppLog() << "\n\nLowess filter demo";
			
		Vector<double> x = {1, 2, 3, 4, 5, 6, 6, 6, 6, 6, 6, 6, 6, 6, 6, 8, 10, 12, 14, 50};
		Vector<double> y = {18, 2, 15, 6, 10, 4, 16, 11, 7, 3, 14, 17, 20, 12, 9, 13, 1, 8, 5, 19};

		Vector<double> ys;
		
		Lowess(x, y, 0.25, 0, 0, ys);

		Vector<double> ys_1 = {13.659,11.145,8.701,9.722,10.000,11.300,11.300,11.300,11.300,11.300,11.300,11.300,11.300,11.300,11.300,13.000,6.440,5.596,5.456,18.998};
		VERIFY(CompareDecimals(ys, ys_1, 3));
		
		if (!test) {
			ScatterDraw scatter;
			scatter.AddSeries(x, y).Legend("Source").NoPlot();
			scatter.AddSeries(x, ys).Legend("Filtered").NoMark();
			
			String dir = AppendFileNameX(GetDesktopFolder(), "STEM4U_Demo");
			scatter.ZoomToFit(true, true).SetLeftMargin(80).SetSize(Size(1000, 500));
			PNGEncoder().SaveFile(AppendFileNameX(dir, "Lowess1.png"), scatter.GetImage());
		}
		
		Lowess(x, y, 0.25, 0, 3, ys);
		
		Vector<double> ys_2 = {13.659,12.347,11.034,9.722,10.511,11.300,11.300,11.300,11.300,11.300,11.300,11.300,11.300,11.300,11.300,13.000,6.440,5.596,5.456,18.998};
		VERIFY(CompareDecimals(ys, ys_2, 3));
		
		if (!test) {
			ScatterDraw scatter;
			scatter.AddSeries(x, y).Legend("Source").NoPlot();
			scatter.AddSeries(x, ys).Legend("Filtered").NoMark();
			
			String dir = AppendFileNameX(GetDesktopFolder(), "STEM4U_Demo");
			scatter.ZoomToFit(true, true).SetLeftMargin(80).SetSize(Size(1000, 500));
			PNGEncoder().SaveFile(AppendFileNameX(dir, "Lowess2.png"), scatter.GetImage());
		}
		
		Lowess(x, y, 0.25, 2, 0, ys);
			
		Vector<double> ys_3 = {14.811, 12.115, 8.984, 9.676, 10.000, 11.346, 11.346, 11.346, 11.346, 11.346, 11.346, 11.346, 11.346, 11.346, 11.346, 13.000, 6.734, 5.744, 5.415, 18.998};
		VERIFY(CompareDecimals(ys, ys_3, 3));
		
		if (!test) {
			ScatterDraw scatter;
			scatter.AddSeries(x, y).Legend("Source").NoPlot();
			scatter.AddSeries(x, ys).Legend("Filtered").NoMark();
			
			String dir = AppendFileNameX(GetDesktopFolder(), "STEM4U_Demo");
			scatter.ZoomToFit(true, true).SetLeftMargin(80).SetSize(Size(1000, 500));
			PNGEncoder().SaveFile(AppendFileNameX(dir, "Lowess3.png"), scatter.GetImage());
		}
	}

	UppLog() << "\n\nLocalFitting demo";

	const Vector<double> vx = {0.5578196,2.0217271,2.5773252,3.4140288,4.3014084,4.7448394,5.1073781,6.5411662,6.7216176,7.2600583,8.1335874,9.1224379,11.9296663,12.3797674,13.2728619,14.2767453,15.3731026,15.6476637,18.5605355,18.5866354,18.7572812};
	const Vector<double> vy = {18.63654,103.49646,150.35391,190.51031,208.70115,213.71135,228.49353,233.55387,234.55054,223.89225,227.68339,223.91982,168.01999,164.9575,152.61107,160.78742,168.55567,152.42658,221.70702,222.6904,243.18828};

	VectorXd x, y, resx, resy, resdy, resd2y;
	CleanNANDupXSort(vx, vy, x, y);	    
	
	if (!test) {
		String dir = AppendFileNameX(GetDesktopFolder(), "STEM4U_Demo");
		RealizeDirectory(dir);
		for (int i = 2; i < 10; ++i) {
			LocalFitting(x, y, resx, resy, resdy, resd2y, 2, i, 20, true);
		
			ScatterDraw scatter;
			scatter.AddSeries(x, y).Legend("Source").NoPlot();
			scatter.AddSeries(resx, resy).Legend("Filtered").NoMark();
			
			scatter.ZoomToFit(true, true).SetLeftMargin(80).SetSize(Size(1000, 500));
			PNGEncoder().SaveFile(AppendFileNameX(dir, Format("LocalFitting_%d.png", i)), scatter.GetImage());
		}
	}
}


